import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Clock from './Clock.js'

function Navbar() {
    return (
        <div id="navbar">
            <p id="navbar-text">
                funny text that's hopefully centered
            </p>
        </div>
    )
}

function Test() {
    return (
        <div id="notnavbar">
            <h1>a very (?) long header</h1>
        </div>
    )
}

function Manytests() {
    return (
        [
            <Navbar key="navbar"/>,
            <Test key="test"/>
        ]
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
